s=e.i9("\ud83c\udfb4 Getting Started","New to the app? Start here!",A.a(["1. Create a new deck or import an existing one","2. Add flashcards with questions and answers","3. Choose a study mode or game to practice","4. Track your progress and improve your learning"],b))
r=e.i9("\ud83c\udfe0 Home Screen Navigation","How to use the main interface",A.a(["**Deck Management:**","\u2022 Click on any deck title to edit it (blue, underlined)","\u2022 Use action icons below each deck:","  - \ud83d\uddd1\ufe0f Delete deck","  - \ud83d\udcc1 Move deck to another category","  - \ud83d\udccb Copy deck to another category","","**Top Bar Controls:**","\u2022 \ud83d\udd04 Refresh: Reload decks from storage","\u2022 \u21ba Reset: Reload default decks from assets","\u2022 \u2753 Help: Open this guide","\u2022 \ud83d\udd0a/\ud83d\udd07 Toggle sounds on/off","","**Categories:**","\u2022 Use dropdown to filter decks by category","\u2022 Default category contains built-in decks","\u2022 Create custom categories to organize your decks"],b))
q=e.i9("\ud83d\udcda Study Mode","Traditional flashcard review with audio",A.a(['\u2022 Click "Study" on any deck to start',"\u2022 Use arrow buttons to navigate between cards","\u2022 Tap the speaker icon to hear pronunciation","\u2022 Switch between front and back sides","\u2022 Enable shuffle for random review","\u2022 Try spaced retention for optimized learning"],b))
p=e.i9("\ud83c\udfae Game Modes","Make learning fun with games!",A.a(["**Typing Game**: Type answers from visual prompts","\u2022 Select question and answer sides","\u2022 Type your answer and submit","\u2022 Get instant feedback and scoring","","**Audio Typing Game**: Listen and type what you hear","\u2022 Click speaker to play audio","\u2022 Type the word or phrase you hear","\u2022 Use hints if you get stuck","","**Multiple Choice**: Select correct answers","\u2022 Choose from 4 possible answers","\u2022 Build speed and accuracy","","**Match Game**: Match corresponding cards","\u2022 Find pairs of matching content","\u2022 Test your memory and recognition","\u2022 \ud83d\udd0d Zoom controls: Adjust text size for better readability","\u2022 \ud83d\udcf1 Responsive layout: More cards on larger screens"],b))
o=e.i9("\ud83d\udd0a Audio Features","Enhanced text-to-speech for better learning",A.a(["\u2022 Automatic language detection","\u2022 High-quality voice synthesis","\u2022 Support for 9+ languages","\u2022 Natural speech rate (0.90)","\u2022 Click language button to change TTS language","","**Supported Languages:**","\u2022 English (en-US)","\u2022 Chinese (zh-CN)","\u2022 Japanese (ja-JP)","\u2022 Korean (ko-KR)","\u2022 Arabic (ar-SA)","\u2022 Russian (ru-RU)","\u2022 Thai (th-TH)","\u2022 Hindi (hi-IN)","\u2022 Hebrew (he-IL)"],b))
n=e.i9("\ud83d\udcc1 Import & Export","Share and backup your flashcards",A.a(["**Import Decks:**",'\u2022 Click "Import Deck" (green + button) on home screen',"\u2022 Upload a CSV file with deck data","\u2022 CSV Format: First row contains headers, subsequent rows contain data",'\u2022 Example: "Question,Answer\\nWhat is 2+2?,4\\nCapital of France?,Paris"',"","**Export Decks:**",'\u2022 Click "Export" on any deck (download icon)',"\u2022 Choose from multiple export options:","  - \ud83d\udce5 Download CSV file for spreadsheet editing","  - \ud83d\udce4 Share CSV file via email/messaging","  - \ud83d\udccb Copy CSV content to clipboard","","**Default Decks:**","\u2022 Built-in decks include Chinese Radicals, Hiragana, and more","\u2022 Click \u21ba (Reset) button to reload default decks from assets","\u2022 Useful if you updated asset files and want to see changes"],b))
m=e.i9("\u2699\ufe0f Settings & Customization","Personalize your learning experience",A.a(["\u2022 Compact mode for smaller screens","\u2022 Theme selection (light/dark)","### Audio Settings","- Click the **Help button** (\u2753) in the top-right for comprehensive guides","- **Language button**: In Study Mode, look for [\ud83e\udd16] button in the top bar","- **\ud83e\udd16 Auto-detect mode**: Automatically switches voices based on content language","- Chinese text \u2192 Chinese voice","- English text \u2192 English voice","- Best for mixed-language decks","- **Manual language selection**: Choose a specific language for all content","- All text uses the selected voice","- Consistent pronunciation practice","- **Override auto-detection**: Manual selection overrides automatic detection","- **Sound Effects**: Games now include audio feedback","- \ud83c\udfb5 Game start sound when any game begins","- \ud83c\udfaf Correct answer sound for right responses","- \u274c Error sound for wrong answers","- \ud83c\udfc1 Game over sound when completed","- \ud83d\udd07 **Mute/Unmute**: Click speaker icon in any game or home screen to toggle sounds","- Enhanced TTS provides natural pronunciation","- Adjustable speech rate in `lib/services/enhanced_tts_service.dart`","\u2022 Change speech rate: setSpeechRate(0.90)","\u2022 Modify voice selection in _setOptimalVoices()"],b))
